(28654, 60444, 0, 1, '相片', '過去的往事在大家心中占有多少份量呢?\r\n這些往事都已成為回憶\r\n\r\n看這過去種種的相片\r\n當時的喜怒哀樂都已不再那麼鮮明\r\n取而代之的是發自內心的微笑\r\n\r\n因為 過去的一切造就了現在的自己\r\n合起相簿\r\n再去添加新的相片吧\r\n', '2010-10-25 00:00:00', 2000, 0, 2, 4, '相片\r\n作詞:Eric Fun\r\n作曲:Eric Fun\r\n編曲:Eric Fun\r\n\r\n今年的秋天 還是什麼都沒能夠實現 我的音樂\r\n往事又浮現 大家的笑容如那日鮮豔 記錄著一切\r\n\r\n愛情恆久遠 相片的留言\r\n彼此 付出了一切 為了我們的明天\r\n\r\n就算都沒兌現 至少我還有那回憶的相片\r\n跌了幾百遍 唱我最真心的情歌\r\n戀愛 甜的讓人暈眩 陪你一天一天又一天\r\n\r\n\r\n\r\n總是皺著眉 現實和夢想永遠都是無解 把握每一天\r\n盡情的表演 就算大雨下著我也不停歇 熱情無限\r\n\r\n絕不再後悔 相片的留言\r\n揮灑著汗水 相信夢想會實現\r\n\r\n就算都沒兌現 至少我還有回憶的相片\r\n提醒 我們當時的笑臉 和 淚水\r\n哼著音樂 我永遠是個少年 走過一天一天又一天\r\n\r\n\r\n人 無法讓齒輪不旋轉 時間會流走\r\n\r\n\r\n手中的 老相片 陪我回憶每一天\r\n秋天是個思念的季節 喔~\r\n我不會再後悔 因為我還有這些珍貴相片\r\n隨手拿起guitar 為妳唱一首情歌\r\n\r\n哼著音樂 旋律自然會浮現 人生的歌曲還等著去寫 喔~\r\n我的音樂 旋律還未到終點 下一段章節等我去冒險\r\n', '', 293, '', 'Eric Fun', 'Eric Fun', 'Eric Fun', '反抗未來搖滾工作室', '', 0, 1, 0, '2010-10-25 23:13:17', '2015-03-12 13:44:05', '0000-00-00 00:00:00'),
