(28659, 60015, 2577, 2, '02.End Up The World', '歌詞內容:\r\n人類總是妄想以為有外太空來的高等文明要毀滅地球，但自始至終一直都是我們在緩慢的殘殺大地之母，End Up The World就是我們每分每秒再做的事，而且毀滅速率是以倍數增長。\r\n這首歌是以反諷為出發的勸世歌曲。\r\n編曲方向:\r\n以新金屬元素、放克節奏、前衛編曲、哈扣精神，合成的一首歌。', '2010-06-05 00:00:00', 2000, 20, 0, 9, '窗外的溫度34度，我們卻在24度的冷氣房簽下京都訂書\r\n手上的飲料14度卻換來氟氯碳化物，它就是無色無味無聲無息的致命因素\r\n我們都知道這樣不好，節能減炭天經地道，但科技進步讓我們都放棄不了\r\n方便的生活要繼續爽只好假裝看不到、聽不到攜手把地球毀滅掉\r\n\r\nMother Fucker\r\n你們什麼都不會，只會看電視\r\nMother Fucker \r\n你們什麼都不會，只會喝醉酒\r\nMother Fucker \r\n你們什麼都不會，只會追潮流\r\nMother Fucker \r\n你們什麼都不會，只會選總統\r\n或許不用等到，2012來到，我們就能看到，天國提早來到\r\n我們總是睜一隻眼閉一隻眼假裝看不到、聽不到把地球毀滅掉\r\n\r\nEnd up the fuckin world .(譯:終結他媽的世界)\r\nEnd up the fuckin world .\r\nEnd up the fuckin world .\r\nEnd up the world .\r\n\r\nThe world will end by our hand .(譯:世界將終結在我們手上)\r\nThe world will end by our hand .\r\nThe world will end by our hand .\r\nThe world will end by our hand .\r\n\r\nAfsa Afsa Maliun Gisu  (阿美族語:膩了，膩了，你們講都講不聽)\r\nAfsa Afsa Maliun Gisu\r\nAfsa Afsa Maliun Gisu\r\nAfsa Afsa \r\n\r\nYou want to stay alive , you better realize.\r\nYou can run can hide or stand up and fight .\r\nThe game is on you better choose your style \r\nat live that determinant your dead style .\r\n(譯:你想活著，你最好清楚的了解\r\n你可以逃走、可以躲避、或者站起來戰鬥\r\n遊戲已經開始了你最好選擇你該怎麼活\r\n因為你怎麼活就決定你將怎麼死)\r\n\r\nThe world will end by our hand .(譯:世界將終結在我們手上)\r\nThe world will end by our hand .\r\nThe world will end by our hand .\r\nThe world will end by our hand .', '', 190, '', '底火', '張逸塵', '張逸塵', '底火', '', 0, 1, 0, '2010-10-27 10:49:46', '2015-03-12 13:44:05', '0000-00-00 00:00:00'),
