(28691, 21634, 0, 1, 'Sweet', '配樂音樂工作募集中！連絡方式：lilychoumusic@gmail.com\r\n更多音樂記錄在 http://lilychoumusic.blogspot.com/', '2010-10-27 00:00:00', 2010, 0, 2, 3, '', '', 118, '', 'Lily Chou', '', 'Lily Chou', 'Lily Chou Music', '', 0, 1, 0, '2010-10-27 22:02:55', '2015-03-12 13:44:06', '0000-00-00 00:00:00'),
(28692, 842, 0, 1, '直覺 (demo)', '描述一種分心而盲目的狀態\r\n描述現代人\r\n焦點錯置的每一天', '2010-10-28 00:00:00', 2010, 0, 1, 7, '畫一座不收費的泳池\r\n在擁擠的城市裡面游泳\r\n換氣的時候浮出水面\r\n猜想你會不會掉頭就走\r\n\r\n唱一首不甚美麗的歌\r\n剛好與你哼的是同一首\r\n脫下了羞恥順便關燈\r\n靈肉分離靈肉分離他說\r\n\r\n閉上眼睛也無法體會\r\n盲目究竟是白還是黑\r\n\r\n* 什麼時候你才會發現\r\n我的臉為你卸下所有防備\r\n在耳邊 無聲的雨 被凌遲的街\r\n太過在意會失去直覺\r\n\r\n抽一支籤或求個半仙\r\n眼耳鼻舌天意口誤他說\r\n交錯的巷子三個路口\r\n誰説人們只會向前走\r\n\r\n* 什麼時候你才會發現\r\n我的臉因你武裝所有防備\r\n在耳邊 任性的雨 放浪的街\r\n太多噪音我失去直覺\r\n\r\n** 那裡沒有彩色的遊行\r\n那裡沒有直播的新聞\r\n那裡沒有故事的終點\r\n那裡只有我\r\n\r\n高解析度的人生\r\n持續專注\r\n外加雜訊自動忽略\r\n有一陣模糊香味\r\n那是我即將隨著雨滴蒸發\r\n\r\n**那裡有你的公路電影\r\n那裡有你的情色照片\r\n那裡有你的動態訊息\r\n那裡沒有我﻿\r\n', '', 248, '', 'Easy', 'Easy', '', '', '', 1, 1, 0, '2010-10-28 01:29:41', '2015-03-12 13:44:06', '0000-00-00 00:00:00'),
