(28796, 11050, 0, 1, 'Stay (Demo 片段试听)', '转身拼凑 脱落的记忆碎片 寻找那些幸福的影子\r\n隐隐的痛与微笑 交织纠缠 不知疲倦\r\n把泪水藏在骄傲的表情背后 用力的 想要挣脱回想的压迫 \r\n却发现 倔强的自己 一直停留在原地 不曾离去\r\n\r\n这是一首关于回忆的歌，年少的日子里总会有那么一个他，陪你听歌，陪你旅行，陪你成长，陪你习惯。\r\n青涩故事的结局总是画上悲伤的句号，我们无力去选择如何结束，只有渐渐学会释然。\r\n\r\n这是一首不再回忆的歌，听它的时候，拉住你身边的那只手，好吗？', '2010-10-28 00:00:00', 0000, 0, 2, 10, '如今我不知该去何方\r\n秋来冬往 黑白过往 疼痛贴近心脏\r\n曾经年少情怀仍未成长\r\n生命无常 岁月漫长 是谁不曾珍惜最好的时光\r\n\r\n新的每一天都像旧日的延续\r\n我被遗忘此地还惦念你现在在哪里\r\n\r\n开始习惯一个人踏上旅行目的地是海边\r\n海风扬起白色裙边轻轻踮起的脚尖\r\n开始习惯一个人寄给你没有地址的明信片\r\n在茫茫人海找寻着谁与你相似的一瞬间  你已不在身边\r\n\r\n有多少眼泪划落唇边你离开转眼又是一年\r\n要怎样停止全部悲伤难道说失去才是永远 \r\n\r\n要学会怎样的坚强才能对你不再想念\r\n要变得怎样的倔强才能对你不再留恋\r\n要拥有怎样的力量才能够停得下时间\r\n要经历怎样的成长才能对回忆说再见  我不要说再见', '', 124, '', '鼓手赤赤', 'Jo酱', '李卓', '鸟先生网络厂牌', '', 0, 1, 0, '2010-10-28 18:35:33', '2015-03-12 13:44:10', '0000-00-00 00:00:00'),
(28797, 11050, 0, 1, '无畏 (Demo 片段试听)', '在10年迷笛首次公开的新Demo「无畏」，保留热血少年的本质，加入成片的爆裂音墙与宣泄碎片，所有躁动的声响都会让你怀疑自己是否已经拥有征服一切的力量。', '2010-10-28 00:00:00', 2000, 0, 2, 10, '都说这世界冷酷 人们胆小而麻木\r\n自负与唯利是图 愤怒的人都孤独\r\n我们才踏上征途 就遇到前路险阻\r\n休想带我入迷途 灵魂我要自己守护\r\n\r\n他们说我一无是处 但我根本不在乎\r\n我们甘愿负重忍辱 但不是屈服\r\n\r\n乌云密布 我躁动不安\r\n断绝后路 只为坚守的信念\r\n交错画面 你渐行渐远\r\n快消失不见 我不能跟随 忘记从前 仰望着天\r\n\r\n睁开你的眼\r\n看清楚我们无畏的脸\r\n忘记了疲倦\r\n爱和正义是力量源泉\r\n你有选择权\r\n如果害怕躲远一点\r\n我不能保证你安全\r\n\r\n他们从不知满足 他们都是格格巫\r\n他们手段尽恐怖 卑鄙是他们巫术\r\n我们满身是泥污 我们早体无完肤\r\n我们就算穷途末路  绝不会臣服\r\n\r\n阴沉幕帘 压向我的双眼\r\n无力化解 你投来绝望的视线\r\n迅烈疾风 又追逐到面前\r\n湮灭了时间 我只有继续向前 直到生命 终结\r\n\r\n背负着夙愿\r\n斩碎黑暗我化作闪电\r\n胜利是明天\r\n誓把世俗邪恶踩脚下\r\n不会虚伪语言\r\n只要世界干净一点\r\n我不会怕任何凶险\r\n\r\n背负着夙愿\r\n斩碎黑暗我化作闪电\r\n胜利是明天\r\n誓把世俗邪恶踩脚下\r\n不会虚伪语言\r\n只要世界干净一点\r\n就让我面对所有危险', '', 195, '', '鼓手赤赤', 'Jo酱', '李卓', '鸟先生网络厂牌', '', 0, 1, 0, '2010-10-28 18:36:41', '2015-03-12 13:44:10', '0000-00-00 00:00:00'),
