(28800, 58994, 0, 1, '還不都是他_1029練團', '', '2010-10-29 00:00:00', 2010, 0, 2, 5, '他 侵占了我透明的思緒  \r\n他 褻瀆了我原始的脾氣\r\n他 傾聽了我滿嘴的髒話\r\n他 也許只是過度的在意\r\n\r\n用力思考著 窒息的問題\r\n一切都是白搭過後 換來更多更多的禁忌\r\n筆筒裡插著鮮花 鮮花上有很多小蒼蠅\r\n車廂裡面裝著小吉他 吉他彈說著\r\n\r\n你走吧 你走吧 你走吧\r\n\r\n他 侵占了我透明的思緒  \r\n他 褻瀆了我原始的脾氣\r\n他 傾聽了我滿嘴的髒話\r\n他 也許只是過度的在意\r\n\r\n放棄 停止 那無聊的問題\r\n就讓時間慢慢沖去 去掉雞皮疙瘩的力氣\r\n筆筒裡插著鮮花 鮮花上有很多小蒼蠅\r\n車廂裡面裝著小吉他 吉他彈說著\r\n\r\n你走吧 你走吧 你走吧', '', 228, '', '軟兔脆狗', '大樂', '', '', '', 0, 1, 0, '2010-10-29 21:44:34', '2015-03-12 13:44:10', '0000-00-00 00:00:00'),
