(28805, 2925, 0, 1, '1997', '基本上就是描寫居住在台中的我們\r\n在所謂的90年代末期,台灣才掀起的britpop浪潮的成長背景\r\n我們當然知道所謂的英國搖滾應該來自90年代初期,中期...\r\n但是這個風潮傳進來台灣的時候已經屆近世紀末了....\r\n當時我們正好是高中這個年紀,當然也是面對著所有\r\n哪個年紀的台灣青少年所面臨的問題,升學考試,畢業...朋友變遷\r\n曖昧不成熟愛情等...當然了這是所有青少年都會有的問題...\r\n無論你是生於台灣或是其他歐美國家...本質上差異並不會太多\r\n哪對我們來說是一段不斷聽著CD隨身聽裡面的OASIS,BLUR,\r\nRADIOHEAD,THE VERVE...等等音樂的年紀....只是因為出身背景\r\n以及居住城市不一樣....我們並沒有像一般台灣較常有印象的年輕樂團\r\n來自台北...或是大學社團出身一樣....我們在高中畢業後面臨著 重考...\r\n就業...夜間部升學,半工半讀在不是哪麼被注意發的台中裡面繼續生活...\r\n這些沒有辦法透過"升學''這個方式前往更有發展都市生活的年輕人...\r\n持續的留在中南部...因為他們可能必須背負更重的生活負擔....\r\n在未滿20歲的時候,我看著我的吉他手每天飛奔打工,夜校設計系,和照顧\r\n生病的家人四處奔走..最後直接去當兵....我們坐在一中街,台中公園等地方.....\r\n想像的事情是如果我們可以像BLUR他們一樣躺在舒服的草地上有個搖滾樂團\r\n哪會是多麼棒的一件事情.....但是在當時的我們並沒有考慮到...\r\n他們是中產階級,而我們都是勞工父母的藍領階級.....\r\n而真的有了樂團之後,為了生活繼續留在台中的我們和那些居住在北部的樂團們\r\n有著多大的距離和差距......我常常覺得更加的無助和失落...\r\n也常常想到我們中學時候單純的1997', '2010-10-30 00:00:00', 2000, 0, 2, 7, '應該是都回不去了\r\n\r\n我卻困在同樣的漩渦裡\r\n\r\n腦海裡重複的旋律  \r\n\r\n當一切慢慢散去我卻還停在1997\r\n\r\n\r\n公園裡一樣的平靜\r\n\r\n湖心亭的顏色也慢慢褪去\r\n\r\n街道上熟悉的人影\r\n\r\n仔細一看哪並不是我和你\r\n\r\n\r\n\r\n收音機撥放熟悉的旋律  live forever 不再響起\r\n\r\n跟著我低著頭不再言語  和青綠色的回憶\r\n\r\n所有顏料都散落滿地  我又聽見到那一些聲音\r\n\r\n I am creep..我停留在過去...1997\r\n\r\n\r\n路燈下煙霧與聲音\r\n\r\n吵鬧的滑板族也慢慢離去\r\n\r\n腦袋裡還保持清醒  \r\n\r\n就算日子早就以混沌不明..\r\n\r\n\r\n收音機撥放熟悉的旋律  live forever 不再響起\r\n\r\n跟著我低著頭不再言語  和青綠色的回憶\r\n\r\n所有顏料都散落滿地  我又聽見到那一些聲音\r\n\r\n I am creep..我停留在過去...1997', '', 296, '', '陳儀銘 賴尚緯 陳禮弘 黃韋勝', '陳儀銘', '', '', '', 1, 0, 1, '2010-10-30 09:22:31', '2013-10-07 17:17:13', '2013-08-30 12:53:47'),
