(28810, 85364, 0, 1, '等 OP', '《等》主题曲', '2010-10-31 00:00:00', 2000, 29, 0, 4, '《等》\n歲月漸漸看清所有誓言的誠懇\n看著到最后誰能夠獲得誰承認\n觀眾拭目以待等著序曲的琴聲\n鋼琴等著回應大眾的信任\n\n時間慢慢奪走每一個人的青春\n光陰瞬間回饋我們成熟的皺紋\n某個遠方某個地點某一位詩人\n厭倦逃避重新踏上旅程\n\n等白天被漆成黃昏\n等著謊言背后的真誠\n等某人回歸的天真\n等到的是不是一場空\n等著愛奇跡的發生\n等著那溫暖的一吻\n等待讓夢擁有了靈魂\n讓人有勇氣去挑戰不可能', '', 208, '', 'Emily 侯君秀', '蔡元龙', 'Emily 侯君秀', 'Storytell Music LLP', '', 0, 1, 0, '2010-10-31 11:48:42', '2015-03-12 13:44:10', '0000-00-00 00:00:00'),
(28811, 85364, 0, 2, '时间旅行 ED', 'Ending song to the mini series, Waiting.\n《等》插曲', '2010-10-31 00:00:00', 2011, 29, 0, 4, '《時間旅行》\n回憶是否早已追上了我\n正在觀賞我的脆弱\n愛過了 傷過了 懂事後 感情怎麼說\n才能偽裝失落\n\n歲月是否向前轉了太多\n太早預告寂寞\n遇見了 離開了 愛情 縫了又破\n終究學會灑脫\n\n時間滴答滴答陪伴凌亂的脈搏\n謊言承諾行李還能裝甚麼\n時間旅行 放逐以後\n珍惜從前 再次體驗 當時犯的錯\n滴答 滴答 細數 心跳的執著\n猜疑 太多 攪亂 永恆的混濁\n時間旅行掙脫以後\n明白思念 或許預言 未來更加閃爍', '', 216, '', 'Emily 侯君秀', '藍潔敏', 'Emily 侯君秀', 'Storytell Music LLP', '', 0, 1, 0, '2010-10-31 12:00:17', '2015-03-12 13:44:10', '0000-00-00 00:00:00'),
